Earth Collection

Science Documentary hosted by Patrick Stewart, published by Discovery Channel in 2012 - English narration


Information
------------------------------

Earth Collection 
An amazing Earth DVD collection will let you in on the secrets of the moon, the sun and the Earth. And everything in between. Join scientists and explorers as they cover every facet of our planet and beyond. The Earth series DVDs are a two-disc set of fascinating landscapes, human and animal life and much more.




5)  Sunrise Earth 
Coast Guard Beach, Cape Cod National Seashore, Massachusetts. From the place where the Mayflower made her first landfall in the New World, we stand at the beginning of what Henry David Thoreau called &quot;The Great Beach.&quot; Here along the backside of Cape Cod, the sun's orb rises directly over an endless Atlantic Ocean swell. But not today, a day when the vestige of a fierce Atlantic storm sends a crashing surf onto the beach. Waves, wind, and sand dance together, alternately eroding the coastline and building the dunes back up. Shorebirds, seals, a lone surfer, and distant surfcasting fishermen search frigid waters for fish, as waves pound the shoreline slope. No Narration


